import React from "react";
import Header from "../page/Booking_system/Header";
import Hero from "../page/Booking_system/Hero";
import Booking from "../page/Booking_system/Booking";
import Footer from "../page/Booking_system/Footer";

const Booking_Parking = () => {
  return (
    <>
      <Header />
      <Hero />
      <Booking />
      <Footer />
    </>
  );
};

export default Booking_Parking;
